import React, { Component } from "react";
import Item from "./Item";

class Items extends Component {
  render() {
    return (
      <React.Fragment>
        {this.props.items.map(item => (
          <Item key={item.id} item={item} onClickAdd={this.props.onClickAdd} />
        ))}
      </React.Fragment>
    );
  }
}

export default Items;
